import React from "react";
import PropTypes from "prop-types";
import classNames from "classnames";
import { withStyles } from "@material-ui/core/styles";
import TextField from "@material-ui/core/TextField";
import "./Symptoms.css";
import {connect} from 'react-redux';
import UserStore from "../../store/user/UserStore";
import Chips from '../../components/UI/Chips';
import PaperSheet from "../../components/UI/Paper";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  Redirect
} from "react-router-dom";

const styles = theme => ({
  container: {
    display: "flex",
    flexWrap: "wrap"
  },
  textField: {
    marginLeft: theme.spacing.unit,
    marginRight: theme.spacing.unit
  },
  dense: {
    marginTop: 16
  },
  menu: {
    width: 200
  }
});

class Symptoms extends React.Component {
  state = {
    headache: false,
    fever: null
  };

  componentDidUpdate() {
    // if(this.props.shouldRedirect) {
    //   return <Redirect to="/patient" 
    // }
  }
  onEmailChange = event => {
    this.setState({
      email: event.target.value
    });
  };
  onPasswordChange = event => {
    this.setState({
      password: event.target.value
    });
  };

  handleHeadAche = () => {
    this.setState(prevState => ({headache : !prevState.headache}));
  }

  onSubmit = event => {
    // const patient = {
    //   email: this.state.email,
    //   password: this.state.password,
    // };

    // console.log(patient);

    // this.props.patientLogIn(patient);
  };

  render() {
    const { classes } = this.props;

    return (
      <PaperSheet className='symptomCard'>
        <div className='symptomContainer'>
          <h1 className='symptomTitle'>Symptom Checker</h1>
          <hr />
          <form className={classes.container} noValidate autoComplete='off'>
            <Chips label="Headache" click={() => this.handleHeadAche()} color={this.state.headache ? 'primary' : 'secondary'} selected={this.state.headache ? true: false}/>
            {/* <TextField
              id='outlined-email-input'
              label='Email'
              className={classes.textField}
              type='email'
              name='email'
              // autoComplete='email'
              margin='normal'
              variant='outlined'
              fullWidth
              onChange={e => this.onEmailChange(e)}
            /> */}
            <br/><br/>
            <button onClick={this.onSubmit} type='button' class='submitButton'>
              SUBMIT
            </button>
          </form>
        </div>
      </PaperSheet>
    );
  }
}

Symptoms.propTypes = {
  classes: PropTypes.object.isRequired
};

const mapStateToProps = state => {
  return {
  };
};

const mapDispatchToProps = dispatch => {
  return {
  };
};

// export default withStyles(styles)(PatientLogin);
export default connect(mapStateToProps, mapDispatchToProps)(withStyles(styles)(Symptoms));
